import React from 'react';
import BookingForm from '../components/BookingForm';
import './BookingPage.css'; // Custom styles for BookingPage if needed

const BookingPage = () => {
  return (
    <div className="booking-page">
      <h1 className="page-header">Book Your Car Rescue Service</h1>
      <BookingForm />
    </div>
  );
};

export default BookingPage;
